import React, { useState, useEffect, useRef } from "react";
import YouTube from "react-youtube"; // Import YouTube player
import "./App.css";

import leftImage from "./assets/images/left-image.jpg";
import rightImage from "./assets/images/right-image.jpg";
import image1 from "./assets/images/image1.jpg"; // Example image 1
import image2 from "./assets/images/image2.jpg"; // Example image 2
import image3 from "./assets/images/image3.jpg"; // Example image 3

const App = () => {
  const [isOpen, setIsOpen] = useState(false); // For controlling slideshow
  const [currentImage, setCurrentImage] = useState(image1); // Active image in slideshow
  const [showWelcomeMessage, setShowWelcomeMessage] = useState(false); // Welcome state
  const playerRef = useRef(null); // YouTube player reference

  // Image slideshow logic
  useEffect(() => {
    let interval;
    if (isOpen && !showWelcomeMessage) {
      interval = setInterval(() => {
        setCurrentImage((prev) => {
          if (prev === image1) return image2;
          if (prev === image2) return image3;
          return image1;
        });
      }, 3000); // Change image every 3 seconds
    }
    return () => clearInterval(interval); // Cleanup on unmount
  }, [isOpen, showWelcomeMessage]);

  // YouTube player ready handler
  const handlePlayerReady = (event) => {
    playerRef.current = event.target; // Set player reference
    playerRef.current.playVideo(); // Start playing video
  };

  // YouTube player options
  const opts = {
    height: "0", // Hidden player
    width: "0",  // Hidden player
    playerVars: {
      autoplay: 1,
      loop: 1,
      controls: 0,
      modestbranding: 1,
      rel: 0,
      playlist: "u03oQwQVR9E", // Repeat requires playlist ID
    },
  };

  return (
    <div className="app-container">
      {/* Left Section */}
      <div className="left-section">
        <div className="announcement-text"><b>WEDDING ANNOUNCEMENT</b></div>
        <h1 className="title">TIFFANY & JARED</h1>
        <p className="quote">
          "Aku ingin mencintaimu dengan sederhana; dengan kata yang tak sempat
          diucapkan kayu kepada api yang menjadikannya abu. Aku ingin
          mencintaimu dengan sederhana; dengan isyarat yang tak sempat
          disampaikan awan kepada hujan yang menjadikannya tiada." <br />— Sapardi Djoko Damono
        </p>
      </div>

      {/* Right Section */}
      <div className="right-section">
        {!isOpen ? (
          <div className="initial-state">
            <div className="announcement-text"><b>WEDDING ANNOUNCEMENT</b></div>
            <h1 className="title">TIFFANY & JARED</h1>
            <p className="hashtag">#TImetoshaRE</p>
            <button className="open-button" onClick={() => setIsOpen(true)}>
              Open
            </button>
          </div>
        ) : (
          <div className="music-container">
            <YouTube videoId="u03oQwQVR9E" opts={opts} onReady={handlePlayerReady} />
            {!showWelcomeMessage ? (
              <div className="slideshow">
                <img src={currentImage} alt="Slideshow" className="slideshow-image" />
                <div className="overlay-text">
                  <div className="announcement-text">WEDDING ANNOUNCEMENT</div>
                  <h1 className="title">TIFFANY & JARED</h1>
                  <p className="hashtag">#TImetoshaRE</p>
                </div>
                <div className="scroll-to-begin" onClick={() => setShowWelcomeMessage(true)}>
                  Scroll to Begin
                </div>
              </div>
            ) : (
              <div className="welcome-message">
                <p className="welcome-text">
                  <b>DEAR MR-MRS-MS,</b><br />
                  Family & Friends<br />
                  Welcome to<br />
                  Tiffany & Jared’s Wedding Website<br /><br />
                  <i>
                    Together with joyful hearts and the grace of God, we joyfully announce the upcoming of our marriage.
                  </i>
                </p>
                <div className="welcome-slideshow">
                  <img src={currentImage} alt="Welcome Slideshow" className="slideshow-image" />
                </div>
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default App;
